protecting the environment for future generations.</p>\", \"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"light-green\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": [328]}',1,'2024-11-27 01:09:28','2024-11-27 01:09:28','28244420-5d74-4c71-8b9a-84991ac903db'),(339,339,2,'Capturing carbon',NULL,NULL,NULL,1,'2024-12-03 00:09:20','2024-12-03 00:09:20','7c73ac8e-3e09-4d24-ae12-3ff3998c644d'),(340,340,2,'Collaborative development',NULL,NULL,NULL,1,'2024-12-03 00:09:20','2024-12-03 00:09:20','0ba74e62-541b-473b-b750-550e1143ac0d'),(341,341,2,'Identifying locations',NULL,NULL,NULL,1,'2024-12-03 00:09:20','2024-12-03 00:09:20','7e9803ce-7cd1-4229-9936-de616ee34bb7'),(342,342,2,'Securing leases',NULL,NULL,NULL,1,'2024-12-03 00:09:21','2024-12-03 00:09:21','b25ce92a-cc6e-4eac-8d7b-a62564c6335d'),(343,343,2,'Sequestering carbon',NULL,NULL,NULL,1,'2024-12-03 00:09:21','2024-12-03 00:09:21','8bdbdd86-6e2e-4782-98b6-5163979ca833'),(344,344,2,'Site prepration',NULL,NULL,NULL,1,'2024-12-03 00:09:21','2024-12-03 00:09:21','cefe99fa-c57b-43ac-84dc-3b3bea670949'),(345,345,2,'Transporting carbon',NULL,NULL,NULL,1,'2024-12-03 00:09:21','2024-12-03 00:09:21','ced3faea-21fd-4c2a-8e36-cf5d803d70d8'),(348,348,2,'Capturing Carbon','capturing-carbon',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Extracting and Compressing Carbon Dioxide from Industrial Emissions\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>The process begins with capturing carbon dioxide (CO) from various industrial sources, such as power plants and natural gas facilities. Using advanced filtration and separation technologies, CO is isolated from other gases and impurities. Once separated, the CO is compressed into a highly concentrated form, preparing it for safe transport and efficient storage.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[339]}',1,'2024-12-03 00:10:29','2025-02-20 19:30:52','03877533-9d74-46f8-906e-1e53be1aea64'),(349,349,2,'Transporting Carbon Safely','transporting-carbon-safely',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Securely Moving Compressed CO to Designated Storage Locations\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>After capture, the compressed CO is transported to storage sites designed specifically for long-term sequestration. Secure pipelines are used to move the carbon, depending on the distance and infrastructure available. Throughout this journey, strict safety protocols and environmental standards are used to minimize any risks and ensure the CO remains contained.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[345]}',1,'2024-12-03 00:10:29','2025-02-20 19:30:52','81b1db07-1a82-4ec6-b9a5-951202584c3f'),(350,350,2,'Sequestering Carbon Underground','sequestering-carbon-underground',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Injecting and Storing Carbon Deep within Geological Formations\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>At the storage site, CO is injected deep underground into porous rock formations, such as depleted oil and gas reservoirs or saline aquifers. These formations are located thousands of feet beneath the surface, beneath layers of impermeable rock that act as natural barriers to prevent any upward migration. This process ensures that the CO remains securely stored, effectively reducing its presence in the atmosphere and contributing to climate change mitigation for generations to come.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[343]}',1,'2024-12-03 00:10:29','2025-02-20 19:30:52','549e6858-c17e-4d8e-9229-34e25687f388'),(351,351,2,'Carbon Injection & Sequestration','carbon-injection-sequestration','land-minerals/carbon-injection-sequestration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\": \"<h1>Innovative solutions for a greener future</h1><p>For decades, Crosby has led the way in sustainable land management. With our carbon injection and sequestration efforts, were advancing our commitment to environmental stewardship, balancing innovation with proven practices to protect our land and atmosphere for future generations.</p>\", \"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"green\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": [85]}',1,'2024-12-03 00:10:29','2024-12-03 00:10:29','124f72a0-fdfc-46b6-9d22-d20e28aedbd6'),(352,352,2,'Capturing Carbon','capturing-carbon',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>Our process begins with capturing carbon dioxide (CO) from various industrial sources, such as power plants and natural gas facilities. Using advanced filtration and separation technologies, we isolate CO from other gases and impurities. Once separated, the CO is compressed into a highly concentrated form, preparing it for safe transport and efficient storage.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [339], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Extracting and Compressing Carbon Dioxide from Industrial Emissions\"}',1,'2024-12-03 00:10:29','2024-12-03 00:10:29','3d56b167-5106-4c03-9049-12934a140401'),(353,353,2,'Transporting Carbon Safely','transporting-carbon-safely',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>After capture, the compressed CO is transported to storage sites designed specifically for long-term sequestration. We use secure pipelines, specialized trucks, or ships to move the carbon, depending on the distance and infrastructure available. Throughout this journey, we adhere to strict safety protocols and environmental standards to minimize any risks and ensure the CO remains contained.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [345], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Securely Moving Compressed CO to Designated Storage Locations\"}',1,'2024-12-03 00:10:29','2024-12-03 00:10:29','8e1e52cc-9d12-4940-a41d-811e2d7641be'),(354,354,2,'Sequestering Carbon Underground','sequestering-carbon-underground',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>At the storage site, we inject the CO deep underground into porous rock formations, such as depleted oil and gas reservoirs or saline aquifers. These formations are located thousands of feet beneath the surface, beneath layers of impermeable rock that act as natural barriers to prevent any upward migration. This process ensures that the CO remains securely stored, effectively reducing its presence in the atmosphere and contributing to climate change mitigation for generations to come.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [343], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Injecting and Storing Carbon Deep within Geological Formations\"}',1,'2024-12-03 00:10:29','2024-12-03 00:10:29','03b52dea-64a7-410a-8beb-88a7c9c50b6f'),(356,356,2,'Carbon Injection & Sequestration','carbon-injection-sequestration','land-minerals/carbon-injection-sequestration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\": \"<h1>Innovative solutions for a greener future</h1><p>For decades, Crosby has led the way in sustainable land management. With our carbon injection and sequestration efforts, were advancing our commitment to environmental stewardship, balancing innovation with proven practices to protect our land and atmosphere for future generations.</p>\", \"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"green\", \"b43447ae-3d31-4a46-a6aa-ff1f680349db\": \"Capture, Transport & Sequester\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": [85]}',1,'2024-12-03 00:26:24','2024-12-03 00:26:24','a550fc37-cd89-4efc-91c6-cb1b753beee6'),(358,358,2,'Carbon Injection & Sequestration','carbon-injection-sequestration','land-minerals/carbon-injection-sequestration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\": \"<h1>Innovative solutions for a greener future</h1><p>For decades, Crosby has led the way in sustainable land management. With our carbon injection and sequestration efforts, were advancing our commitment to environmental stewardship, balancing innovation with proven practices to protect our land and atmosphere for future generations.</p>\", \"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"green\", \"b43447ae-3d31-4a46-a6aa-ff1f680349db\": \"Capture, Transport & Sequester\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": [85]}',1,'2024-12-03 02:36:22','2024-12-03 02:36:22','b6fe3c3c-1b6e-4e53-9561-4a0e7185e2b1'),(360,360,2,'Crosby Resource Management','resource-management','company/resource-management','{\"03cde428-993b-4659-9ae5-a250bef25995\": \"Explore our diverse services to maximize land potential and preserve its future.\", \"17f13d88-c24b-45ec-a9a8-b72e351a64e0\": [110, 342], \"1b5bf0c4-937e-4f9e-9fd0-dfc1e53ce6c9\": \"Were trusted\", \"248d9bff-c9f9-4050-93ab-d7ed29dc3cb2\": \"margin-top\", \"70e14685-be41-435e-8982-4b74f9192f09\": \"Services we offer\", \"788f5aa5-4cdf-4696-bcf3-77c383426c53\": \"red\", \"7df86719-f2be-407a-aa55-d39fcfb4888d\": \"Our expertise in land management\", \"b9fa69eb-557e-4d58-b68a-bef16f823fca\": \"Hear first hand from our partners & clients\", \"bf56f9d8-677b-438b-9955-f2c1c1fb35f0\": \"margin-bottom\", \"f0f656d0-b5be-4ed1-9e07-e1e0d9c6b76a\": \"<figure class=\\\"image\\\"><img style=\\\"aspect-ratio:539/123;\\\" src=\\\"{asset:109:url||/uploads/general/crm-logo.svg}\\\" alt=\\\"\\\" width=\\\"539\\\" height=\\\"123\\\" /></figure><p></p><p>Crosby Resource Management (CRM) was founded by Crosby Land &amp; Resources in 2007. CRM provides complete forest management and real estate services to landowners with 40 to over 100,000 acres. Headquartered inDeRidder, Louisiana, CRM now has clients across Southwest Louisiana.</p>\"}',1,'2024-12-03 04:59:54','2024-12-03 04:59:54','72efbf5b-2f43-4db5-b631-2247efa1c22a'),(363,363,2,'Site Assessment and Preparation','test',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Evaluating Land for Optimal Resource Development\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>The exploration process starts with a comprehensive assessment of potential sites to identify areas with the highest oil and gas potential. We help facilitate geological surveys, environmental studies, and community consultations to ensure each site is suitable for development, balancing energy p