. His expertise in timber management, wildlife conservation, and ecosystem restoration has made him a key figure in advancing the companys mission to responsibly manage over 134,000 acres.</p><p>Clay is known for his hands-on approach, often collaborating with local conservationists, contractors, and community stakeholders to enhance the lands value both economically and environmentally. He is particularly committed to restoring native habitats and implementing sustainable forestry practices that benefit both the land and the wildlife that depend on it. Outside of his work, Clay is an avid hunter and enjoys mentoring young foresters, passing on his knowledge and dedication to the next generation of land managers. His deep connection to the land and his community reflect the core values of Crosby Resource Management.</p>\", \"c598f3ba-76bf-402a-82bb-372733724888\": \"Senior Land Steward\", \"fe33b24c-8ecb-4c14-955a-f10245b37458\": [405]}',1,'2024-12-04 22:59:53','2024-12-04 22:59:53','4ca9313c-7ec1-4f0c-8d48-cefbcf7648fb'),(538,538,2,'Gavin Garcie','crosby',NULL,'{\"5eb25c4e-2e11-4a0c-9070-2ee1bad8a0b2\":[2010],\"fe33b24c-8ecb-4c14-955a-f10245b37458\":[],\"c598f3ba-76bf-402a-82bb-372733724888\":\"Forester - Area Manager\",\"c2fbbc78-da61-4d4a-bde6-1c781101f1be\":\"<p>Gavin has dedicated over 20 years of his career to Crosby Resource Management, where he oversees forestry operations and leads initiatives focused on sustainable land stewardship. With a background in environmental science and a lifelong passion for forestry, Clay ensures that all of the companys land is carefully managed with a focus on ecological preservation and long-term productivity. His expertise in timber management, wildlife conservation, and ecosystem restoration has made him a key figure in advancing the companys mission to responsibly manage over 134,000 acres.</p>\",\"bce8a78b-0220-4d83-bcfe-53fa0beb1bd4\":\"Ggarcie@crosbyresource.com\",\"123a45a4-3b8a-4a04-93b9-9da9cc635d84\":{\"value\":\"te