3:02:04','2024-12-05 03:37:01','639f4765-a8eb-4cb3-9f75-946acb650a3a'),(569,569,2,'History','history','about/history',NULL,1,'2024-12-05 03:02:04','2024-12-05 03:02:04','acf430a0-59c0-497c-aa46-e7cc47432ded'),(570,570,2,NULL,'__temp_vvzskwnvfuxfdvoaqxiqmaawcchbkezxqpnn',NULL,'{\"091cf9f9-54e9-4727-a6e8-0e69007b897a\": \"red\", \"60bd2228-3e30-4f2b-8a42-0c7bb2be3610\": [567], \"ebcc3f78-ddc2-4556-9d54-531a1b99d364\": \"<p>Establishing the first connections with local communities and conservation efforts.</p>\"}',1,'2024-12-05 03:02:04','2024-12-05 03:02:04','78207bb0-9d24-4196-bbbe-31878a5fd32e'),(573,573,2,'History','history','about/history',NULL,1,'2024-12-05 03:25:11','2024-12-05 03:25:11','95ecc6f8-f6aa-4af0-9b21-c1503f9a2a12'),(574,574,2,NULL,'__temp_cqmujahogpzbplmwakgaomdidnekpemselkm',NULL,'{\"091cf9f9-54e9-4727-a6e8-0e69007b897a\": \"red\", \"60bd2228-3e30-4f2b-8a42-0c7bb2be3610\": [567], \"ebcc3f78-ddc2-4556-9d54-531a1b99d364\": \"<p>Establishing the first connections with local communities and conservation efforts.</p>\"}',1,'2024-12-05 03:25:11','2024-12-05 03:25:11','c2febe56-c75f-4851-8f36-9691e06b61bc'),(579,579,2,'Expansion Post-War','expansion-post-war',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1945,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Growth and Diversification After World War II\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<p>Due to its location in the middle of thousands of acres of \\\"virgin\\\" stump land, on three railroads, and within 50 miles of a deep water port, DeRidder, Louisiana, was selected as the location for a second plant. The land was considered poor and without much value and the purchase price reflected that fact. The resources that lay in these lands, predominantly longleaf pine stumps.</p><p>Robert H. Crosby Jr. joined the business full time after serving in WWII and headed to DeRidder for construction of LA plant. Soon after Robert H. Crosby Jr.s two brothers, Richard (Dick) Crosby and Tom Crosby joined the company and ran the sales and plant operations.</p><p>Thus, by 1947, from a small beginning 10 years earlier of a facility with a 250 ton daily capacity, Crosby Naval Stores grew into a successfulorganization, encompassing 2 plant facilities,capable of processing 1,600 tons of stumps daily. Crosby Naval Stores employed between 500 and 600 people in plant operations and from 1,000 to 1,200 in stump operations.</p>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"charcoal\"}',1,'2024-12-05 03:37:01','2025-04-09 18:01:15','faf6fe59-f3f4-451c-8459-589778cf3ead'),(580,580,2,'History','history','about/history',NULL,1,'2024-12-05 03:37:01','2024-12-05 03:37:01','7dae9a0f-e634-43a5-9ff7-6734ec107582'),(581,581,2,'The Beginning','the-beginning',NULL,'{\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\": \"<p>In 1934, Crosby Resource Management was founded by John Crosby, a visionary who saw the potential in managing Southern Louisianas vast forests sustainably. At the time, much of the regions land was left unmanaged, and the logging industry was booming. John Crosby sought to create a company that could harvest timber responsibly while ensuring the lands long-term productivity. His early efforts laid the foundation for what would become one of the most respected land management companies in the region, with a focus on balancing economic growth with ecological preservation.</p>\", \"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\": \"Founding of Crosby Resource Management\", \"f47025ea-51f8-4636-9d11-c7095203cb70\": \"charcoal\"}',1,'2024-12-05 03:37:01','2024-12-05 03:37:01','d1a88283-e4fd-43cf-92bd-1710e489b7d8'),(582,582,2,NULL,'__temp_apxjczrmjdhhwwudsouyfnssnmfsgnttsamu',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\": \"charcoal\"}',1,'2024-12-05 03:37:01','2024-12-05 03:37:01','b47f2bd5-af15-4f37-8649-9f5826a3a81c'),(583,583,2,NULL,'__temp_kpijseuuftyedgmvkugjwlsrhmbkprabmxdy',NULL,'{\"091cf9f9-54e9-4727-a6e8-0e69007b897a\": \"charcoal\", \"60bd2228-3e30-4f2b-8a42-0c7bb2be3610\": [567], \"ebcc3f78-ddc2-4556-9d54-531a1b99d364\": \"<p>Establishing the first connections with local communities and conservation efforts.</p>\"}',1,'2024-12-05 03:37:01','2024-12-05 03:37:01','c1ff60dd-93ad-487f-aada-bda56853c100'),(584,584,2,'Expansion Post-War','expansion-post-war',NULL,'{\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\": \"<p>After World War II, demand for timber surged as America began to rebuild. Crosby Resource Management responded by expanding its operations, purchasing new tracts of land across Southern Louisiana. The company also diversified its operations, moving into areas like land clearing and timber processing. During this period, Crosby became known not just for its forestry practices, but for its innovation in utilizing every part of the land, from timber to soil conservation. The post-war expansion set the stage for the companys future growth.</p>\", \"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\": \"Growth and Diversification After World War II\", \"f47025ea-51f8-4636-9d11-c7095203cb70\": \"charcoal\"}',1,'2024-12-05 03:37:01','2024-12-05 03:37:01','24f71d04-997d-4698-a767-b4f0d2da4701'),(588,588,2,'History','history','about/history',NULL,1,'2024-12-05 03:43:29','2024-12-05 03:43:29','5c057896-7d5e-4e33-92da-1bf46a2e4ffc'),(589,589,2,'The Beginning','the-beginning',NULL,'{\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\": \"<p>In 1934, Crosby Resource Management was founded by John Crosby, a visionary who saw the potential in managing Southern Louisianas vast forests sustainably. At the time, much of the regions land was left unmanaged, and the logging industry was booming. John Crosby sought to create a company that could harvest timber responsibly while ensuring the lands long-term productivity. His early efforts laid the foundation for what would become one of the most respected land management companies in the region, with a focus on balancing economic growth with ecological preservation.</p>\", \"582d1ba6-ac48-4124-8202-3eb246013891\": 1932, \"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\": \"Founding of Crosby Resource Management\", \"f47025ea-51f8-4636-9d11-c7095203cb70\": \"charcoal\"}',1,'2024-12-05 03:43:29','2024-12-05 03:43:29','a60229b4-2579-450b-9a8f-05e0ca495a12'),(590,590,2,'Expansion Post-War','expansion-post-war',NULL,'{\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\": \"<p>After World War II, demand for timber surged as America began to rebuild. Crosby Resource Management responded by expanding its operations, purchasing new tracts of land across Southern Louisiana. The company also diversified its operations, moving into areas like land clearing and timber processing. During this period, Crosby became known not just for its forestry practices, but for its innovation in utilizing every part of the land, from timber to soil conservation. The post-war expansion set the stage for the companys future growth.</p>\", \"582d1ba6-ac48-4124-8202-3eb246013891\": 1945, \"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\": \"Growth and Diversification After World War II\", \"f47025ea-51f8-4636-9d11-c7095203cb70\": \"charcoal\"}',1,'2024-12-05 03:43:29','2024-12-05 03:43:29','f5ce8e63-fe0a-4b0e-b3ea-979ed7911849'),(592,592,2,'History','history',NULL,'{\"224307fc-0b13-4f92-9d50-f57a5b038b8b\": {\"type\": \"entry\", \"label\": null, \"value\": \"{entry:489@2:url}\", \"target\": null}}',1,'2024-12-05 20:32:52','2024-12-05 20:32:52','0eb00ec6-6f49-4010-8665-4f59dba2dc62'),(593,593,2,NULL,'__temp_vlbkydzfqzsorexynjywyihhpodwureahinb','land-minerals/__temp_vlbkydzfqzsorexynjywyihhpodwureahinb','{\"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"red\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": []}',1,'2024-12-06 04:28:04','2024-12-06 04:28:04','4a5f659a-a22b-4c29-900d-6803996756e3'),(594,594,2,NULL,'__temp_ryyofhqdnpasjozgutiipiqqeqiqhapafmnl','land-minerals/__temp_ryyofhqdnpasjozgutiipiqqeqiqhapafmnl','{\"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"red\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": []}',1,'2024-12-06 04:28:04','2024-12-06 04:28:04','2e9442d1-d34e-46b3-bf76-c83bbe31215b'),(595,595,2,'Land Sales','land-sales','land-minerals/land-sales','{\"a2094f8f-21e4-47cd-878d-603272fea893\":\"<p>From serene forest retreats to dynamic development sites, our properties offer unmatched potential for growth, recreation, and conservation.</p>\"}',1,'2024-12-06 04:34:41','2025-02-27 00:39:00','a705052c-e935-478c-ac29-0ef9f2f604ed'),(596,596,2,'Real Estate','real-estate','land-minerals/real-estate','{\"a2094f8f-21e4-47cd-878d-603272fea893\": \"<p>Text goes here</p>\"}',1,'2024-12-06 04:34:52','2024-12-06 04:34:52','e8081ddc-0938-4a9d-94eb-e8fd45c1e1e4'),(597,597,2,'Real Estate','real-estate','land-minerals/real-estate','{\"a2094f8f-21e4-47cd-878d-603272fea893\": \"<p>Text goes here</p>\"}',1,'2024-12-06 04:35:01','2024-12-06 04:35:01','0376137a-6ecf-47e2-b942-c32c0fb865d4'),(598,598,2,'Carbon Injection & Sequestration','carbon-injection-sequestration','land-minerals/carbon-injection-sequestration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\": \"<h1>Innovative solutions for a greener future</h1><p>For decades, Crosby has led the way in sustainable land management. With our carbon injection and sequestration efforts, were advancing our commitment to environmental stewardship, balancing innovation with proven practices to protect our land and atmosphere for future generations.</p>\", \"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"green\", \"b43447ae-3d31-4a46-a6aa-ff1f680349db\": \"Capture, Transport & Sequester\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": [85]}',1,'2024-12-06 04:36:24','2024-12-06 04:36:24','c2ad7cfc-bf7d-4fe2-956b-30f83c70b6f6'),(599,599,2,'Capturing Carbon','capturing-carbon',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>Our process begins with capturing carbon dioxide (CO) from various industrial sources, such as power plants and natural gas facilities. Using advanced filtration and separation technologies, we isolate CO from other gases and impurities. Once separated, the CO is compressed into a highly concentrated form, preparing it for safe transport and efficient storage.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [339], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Extracting and Compressing Carbon Dioxide from Industrial Emissions\"}',1,'2024-12-06 04:36:24','2024-12-06 04:36:24','6312bc22-9d56-4a20-ae16-2587f6467052'),(600,600,2,'Transporting Carbon Safely','transporting-carbon-safely',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>After capture, the compressed CO is transported to storage sites designed specifically for long-term sequestration. We use secure pipelines, specialized trucks, or ships to move the carbon, depending on the distance and infrastructure available. Throughout this journey, we adhere to strict safety protocols and environmental standards to minimize any risks and ensure the CO remains contained.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [345], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Securely Moving Compressed CO to Designated Storage Locations\"}',1,'2024-12-06 04:36:24','2024-12-06 04:36:24','af53c736-9c6d-4298-9b43-74402e1b3d20'),(601,601,2,'Sequestering Carbon Underground','sequestering-carbon-underground',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>At the storage site, we inject the CO deep underground into porous rock formations, such as depleted oil and gas reservoirs or saline aquifers. These formations are located thousands of feet beneath the surface, beneath layers of impermeable rock that act as natural barriers to prevent any upward migration. This process ensures that the CO remains securely stored, effectively reducing its presence in the atmosphere and contributing to climate change mitigation for generations to come.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [343], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Injecting and Storing Carbon Deep within Geological Formations\"}',1,'2024-12-06 04:36:24','2024-12-06 04:36:24','9ed7a333-4a7c-437d-bf74-a26741470896'),(602,602,2,'Bayou Pine Tract','bayou-pine-tract','land-minerals/real-estate/bayou-pine-tract','{\"20c831f6-11db-40d3-8cf1-b29e858a7ee5\": \"200\", \"599aea67-23c0-4160-b66a-299056df51b1\": 125000, \"5e1a8425-76f0-4ab6-b746-0d7c4a96f380\": [1084], \"7a9c701e-6e74-4854-9dbb-919c1556750a\": [614, 613, 612, 611, 610], \"7bbc9119-36fe-474b-acb2-60e803062b81\": [], \"8217b770-4692-43ce-a037-1964af20c2aa\": \"<p>A prestine tract located near Bayou Teche, offering a mix of mature pine and hardwood forest. This property is ideal for timber production, recreation, and conservation purposes.</p>\", \"e7527778-a977-4984-8bf6-2ccbb508c901\": [438]}',1,'2024-12-06 04:48:31','2024-12-12 00:01:33','d1b9678c-f171-47b5-8459-7043b7682b38'),(603,603,2,'Bayou Pine Tract','__temp_qqgnpspucttbohysaufaftffsjcaduivxahc',NULL,NULL,1,'2024-12-06 04:48:51','2024-12-06 04:49:46','8886c1c4-af39-4c4c-a348-8c05e4996111'),(604,604,2,'Soil Type','soil-type',NULL,'{\"9a1a1e19-d04d-4dab-9010-79d77d0f6c00\": \"<p>Sandy loam, suitable for various tree species and wildlife habitat</p>\"}',1,'2024-12-06 04:49:55','2024-12-06 04:50:08','43dde2eb-1107-41c1-a829-d8f977c5c171'),(605,605,2,'Timber Type','timber-type',NULL,'{\"9a1a1e19-d04d-4dab-9010-79d77d0f6c00\": \"<p>60% Southern Yellow Pine, 40% Mixed Hardwood</p>\"}',1,'2024-12-06 04:50:10','2024-12-06 04:50:19','d6c4a74e-1212-49fb-b88e-9a8bc1dfb972'),(606,606,2,'Access','access',NULL,'{\"9a1a1e19-d04d-4dab-9010-79d77d0f6c00\": \"<p>Direct road access via a well-maintained gravel road</p>\"}',1,'2024-12-06 04:50:21','2024-12-06 04:50:29','4602bd82-0e06-4a31-8aae-979610fd8246'),(607,607,2,'Utilities','utilities',NULL,'{\"9a1a1e19-d04d-4dab-9010-79d77d0f6c00\": \"<p>No utilities currently on-site; electric grid access within 2 miles</p>\"}',1,'2024-12-06 04:50:35','2024-12-06 04:50:40','3853eb41-4319-4867-abde-080fed22a3da'),(608,608,2,'Current Use','current-use',NULL,'{\"9a1a1e19-d04d-4dab-9010-79d77d0f6c00\": \"<p>Managed forest with an active timber lease</p>\"}',1,'2024-12-06 04:50:49','