new-millennium-of-growth',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1990,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Expanding Beyond Timber\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:disc;\\\"><li><strong>Crosby Chemicals</strong>changed its name to<strong>Crosby Land&amp; Resources</strong>, a Mississippi partnership.</li><li>The Company saw unprecedented development of its minerals from 1995-2001 due primarily to the oil and gas exploration of the Austin Chalk geological formation.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2024-12-06 20:24:57','2025-04-09 18:01:15','bea60843-bf01-4a24-81b2-e097437e3cc6'),(759,759,2,NULL,'__temp_ibveuaejzqcpattzylxmeqwucpnqikzprfwa',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\": \"red\"}',1,'2024-12-06 20:24:57','2024-12-06 20:28:23','6973dab1-4974-495e-ae45-45db578a4470'),(760,760,2,NULL,'__temp_uesgmxocvmpkyknguqpblojyraccpnfrcgtj',NULL,'{\"8085fcfa-8e71-4bff-8880-643e4a50ada8\": \"<p>The creation of Crosby Land &amp; Resources marks a milestone in the companys evolution.</p>\", \"8f1fee78-5e88-4c07-b799-f61f4008596b\": 6, \"d8a8501a-e52a-4044-928c-27a4ab046612\": [742]}',1,'2024-12-06 20:24:57','2024-12-06 20:27:51','2eeef4fe-124f-4780-b83a-d056ca1a5435'),(761,761,2,NULL,'__temp_uudqlrjqvlyqwupnjfdjggpyeggtfnrocmmt',NULL,'{\"8085fcfa-8e71-4bff-8880-643e4a50ada8\": \"<p>A dedicated division for managing vast landholdings and diverse land uses.</p>\", \"8f1fee78-5e88-4c07-b799-f61f4008596b\": 5, \"d8a8501a-e52a-4044-928c-27a4ab046612\": [344]}',1,'2024-12-06 20:24:57','2024-12-06 20:28:23','f727fb1c-530e-45de-995a-ebe74504bc24'),(762,762,2,NULL,'__temp_genecphhvszljecolmmhuycoymcuneenqhjm',NULL,'{\"8f1ac14d-b468-486f-ac52-c9481fa77611\": \"red\", \"e0bb6651-04f1-46c9-b56d-338199065ec1\": \"<h2>Entering the new millennium, Crosby Resource Management embraced diversification, venturing beyond timber into real estate, hunting leases, and conservation. This pivotal shift ensured that our land would continue to thrive, providing value for both today and future generations.</h2>\"}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','a92e0c47-d9ad-44fc-abee-0a6127dc4309'),(763,763,2,'Back to our \"Roots\"','renewable-energy-initiatives',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":2007,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Taking on a direct roll in the management of our timberland\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:disc;\\\"><li>The Company formed<strong>Crosby Resource Management, L.L.C.</strong>, a full service forest management company, headquartered in Sugartown, Louisiana.</li><li>CRM\'s primary roll was to manage the timberland as it was incramentally released by a commercial timber management group, which had opperated under a long term lease for many years.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"white\"}',1,'2024-12-06 20:24:57','2025-05-06 14:43:36','dddb6a6f-495f-4e0e-a057-a1b8ea9f5b8d'),(764,764,2,NULL,'__temp_svtjqxpdbnjhduhyttvgbffddgzqnctycbfr',NULL,'{\"091cf9f9-54e9-4727-a6e8-0e69007b897a\": \"white\", \"60bd2228-3e30-4f2b-8a42-0c7bb2be3610\": [748], \"ebcc3f78-ddc2-4556-9d54-531a1b99d364\": \"<p>Crosby partners with solar developers to lease land for renewable energy projects.</p>\"}',1,'2024-12-06 20:24:57','2024-12-06 20:25:32','3a1dd46d-2e0d-4639-b0ec-e8d6aa131f75'),(765,765,2,'Looking to the Future','looking-to-the-future',NULL,'{\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\": \"<p>Today, Crosby Resource Management is more committed than ever to preserving the legacy of responsible land management. With over 134,000 acres of managed land, the company continues to lead the industry in sustainable forestry, conservation, and land development. As new generations of the Crosby family take the reins, they remain focused on adapting to the changing landscape of land management, ensuring that the companys mission of stewardship and sustainability endures for decades to come.</p>\", \"582d1ba6-ac48-4124-8202-3eb246013891\": 2024, \"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\": \"A Legacy of Sustainability and Innovation\", \"f47025ea-51f8-4636-9d11-c7095203cb70\": \"white\"}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','1252819f-ac58-4ed7-9003-3abeeed5df7d'),(766,766,2,NULL,'__temp_bmqzyuyzwmhwjuejhsidrawbinbrtvcwacjm',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\": \"white\"}',1,'2024-12-06 20:24:57','2024-12-19 21:35:27','ba1f72cb-9e20-4e35-99a6-6395e8ba4331'),(767,767,2,NULL,'__temp_eahmaiywzieukrrxiorrkhajsbrbnyvaiezx',NULL,'{\"8085fcfa-8e71-4bff-8880-643e4a50ada8\": \"<p>Carter Crosby at the start of his journey, laying the foundation for sustainable land management.</p>\", \"8f1fee78-5e88-4c07-b799-f61f4008596b\": 4, \"d8a8501a-e52a-4044-928c-27a4ab046612\": [752]}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','07ae796e-b7cb-409c-a585-e36fd48c01a6'),(768,768,2,NULL,'__temp_ahaynrpxhzxoedkbjqlidrvugwnulpebtqth',NULL,'{\"8085fcfa-8e71-4bff-8880-643e4a50ada8\": \"<p>The early days of Crosby Resource Management, focused on sustainable timber harvesting.</p>\", \"8f1fee78-5e88-4c07-b799-f61f4008596b\": 6, \"d8a8501a-e52a-4044-928c-27a4ab046612\": [753]}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','2748d900-9876-4bf1-b981-7cf5552d97e9'),(769,769,2,NULL,'__temp_wagksyqqknjqcqgvydrfycmguwuwtiwzkppu',NULL,'{\"8f1fee78-5e88-4c07-b799-f61f4008596b\": 6, \"d8a8501a-e52a-4044-928c-27a4ab046612\": [754]}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','c4180704-e6af-4f10-bd98-ba622c33f417'),(770,770,2,'History','history','about/history',NULL,1,'2024-12-06 20:24:57','2024-12-06 20:24:57','2411636e-dbb1-456d-9a1e-11025fdb504b'),(771,771,2,'A New Millennium of Growth','a-new-millennium-of-growth',NULL,'{\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\": \"<p>As the 21st century began, Crosby Resource Management sought to diversify its operations beyond timber. In 2000, the company began leasing land for alternative uses, including hunting leases, real estate development, and conservation projects. This shift allowed the company to maximize the value of its land while staying true to its sustainable practices. The diversification also opened up new revenue streams, ensuring the companys financial health while supporting its long-term goals of land conservation.</p>\", \"582d1ba6-ac48-4124-8202-3eb246013891\": 2000, \"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\": \"Expanding Beyond Timber\", \"f47025ea-51f8-4636-9d11-c7095203cb70\": \"red\"}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','a6424206-01d5-4a40-8f74-c7201bf26f79'),(772,772,2,NULL,'__temp_dvpuhiavyccbnsmrlxbxltulbpuikhwbndqo',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\": \"red\"}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','5b84cea5-9858-4b43-b37c-58eb4066ef70'),(773,773,2,NULL,'__temp_tlglymzwzdszhpjohivtttpfdgkfldfbwvlw',NULL,'{\"8085fcfa-8e71-4bff-8880-643e4a50ada8\": \"<p>The creation of Crosby Land &amp; Resources marks a milestone in the companys evolution.</p>\", \"8f1fee78-5e88-4c07-b799-f61f4008596b\": 5, \"d8a8501a-e52a-4044-928c-27a4ab046612\": [742]}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','a04f3928-1e0c-4c73-bbd8-6633b3423501'),(774,774,2,NULL,'__temp_paqrdeegwtzeltwnwuvvshjzxqcvzcvdmivl',NULL,'{\"8085fcfa-8e71-4bff-8880-643e4a50ada8\": \"<p>A dedicated division for managing vast landholdings and diverse land uses.</p>\", \"8f1fee78-5e88-4c07-b799-f61f4008596b\": 6, \"d8a8501a-e52a-4044-928c-27a4ab046612\": [344]}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','5c3f62b0-cb70-4cd7-b619-67fb008b5e25'),(775,775,2,NULL,'__temp_genecphhvszljecolmmhuycoymcuneenqhjm',NULL,'{\"8f1ac14d-b468-486f-ac52-c9481fa77611\": \"red\", \"e0bb6651-04f1-46c9-b56d-338199065ec1\": \"<h2>Entering the new millennium, Crosby Resource Management embraced diversification, venturing beyond timber into real estate, hunting leases, and conservation. This pivotal shift ensured that our land would continue to thrive, providing value for both today and future generations.</h2>\"}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','d0522916-e214-42ca-92ff-07782667b66f'),(776,776,2,'Renewable Energy Initiatives','renewable-energy-initiatives',NULL,'{\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\": \"<p>In 2012, Crosby Resource Management began exploring renewable energy initiatives. The company partnered with local and national energy companies to lease land for solar farm development, marking a new chapter in its long history of land management. At the same time, Crosby also invested in carbon sequestration projects, using its land to help capture and store carbon dioxide. These initiatives demonstrated Crosbys commitment to innovation and environmental responsibility, positioning the company as a leader in the emerging green energy sector.</p>\", \"582d1ba6-ac48-4124-8202-3eb246013891\": 2012, \"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\": \"Investing in Solar and Carbon Sequestration\", \"f47025ea-51f8-4636-9d11-c7095203cb70\": \"white\"}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','beccb012-b904-4e21-ab12-36b9d8a71f37'),(777,777,2,NULL,'__temp_fhxwdvnzsksklcugrccbrkmbyvwynwrqvzis',NULL,'{\"091cf9f9-54e9-4727-a6e8-0e69007b897a\": \"red\", \"60bd2228-3e30-4f2b-8a42-0c7bb2be3610\": [748], \"ebcc3f78-ddc2-4556-9d54-531a1b99d364\": \"<p>Crosby partners with solar developers to lease land for renewable energy projects.</p>\"}',1,'2024-12-06 20:24:57','2024-12-06 20:24:57','89da0887-b0e1-4fcd-9b04-18870869a9da'),(778,778,2,'Looking to the Future','looking-to-the-future',NULL,'{\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\": \"<p>Today, Crosby Resource Management is more committed than ever to preserving the legacy of responsible land management. With over 134,000 acres of managed land, the company continues to lead the industry in sustainable forestry, conservation, and land development. As new generations of the Crosby family take the reins, they remain focused on adapting to the changing landscape of land management, ensuring that the companys mis