b508c901\": []}',1,'2024-12-12 21:55:07','2024-12-12 21:55:07','dd3dd5d5-9530-4bf3-8cef-fbd7d237706c'),(1124,1124,2,'Riverbend Retreat','bayou-pine-tract-2','land-minerals/real-estate/bayou-pine-tract-2','{\"20c831f6-11db-40d3-8cf1-b29e858a7ee5\": \"78\", \"599aea67-23c0-4160-b66a-299056df51b1\": 15000, \"5e1a8425-76f0-4ab6-b746-0d7c4a96f380\": [1091], \"7a9c701e-6e74-4854-9dbb-919c1556750a\": [610, 614, 613, 612, 611], \"7bbc9119-36fe-474b-acb2-60e803062b81\": [], \"8217b770-4692-43ce-a037-1964af20c2aa\": \"<p>The river bend retreat description</p>\", \"e7527778-a977-4984-8bf6-2ccbb508c901\": []}',1,'2024-12-12 21:55:21','2024-12-12 21:55:21','a7533fbd-6b03-4de9-b24c-51d666c0bb77'),(1125,1125,2,'Carbon Injection & Sequestration','carbon-injection-sequestration','land-minerals/carbon-injection-sequestration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\": \"<h1>Innovative solutions for a greener future</h1><p>For decades, Crosby has led the way in sustainable land management. With our carbon injection and sequestration efforts, were advancing our commitment to environmental stewardship, balancing innovation with proven practices to protect our land and atmosphere for future generations.</p>\", \"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"green\", \"b43447ae-3d31-4a46-a6aa-ff1f680349db\": \"Capture, Transport & Sequester\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": [85]}',1,'2024-12-13 20:53:58','2024-12-13 20:53:58','85a21043-5773-4319-9bc9-5aeba973190e'),(1126,1126,2,'Capturing Carbon','capturing-carbon',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>Our process begins with capturing carbon dioxide (CO) from various industrial sources, such as power plants and natural gas facilities. Using advanced filtration and separation technologies, we isolate CO from other gases and impurities. Once separated, the CO is compressed into a highly concentrated form, preparing it for safe transport and efficient storage.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [339], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Extracting and Compressing Carbon Dioxide from Industrial Emissions\"}',1,'2024-12-13 20:53:58','2024-12-13 20:53:58','75af9dce-11ca-41d8-9cb6-f25009314ef1'),(1127,1127,2,'Transporting Carbon Safely','transporting-carbon-safely',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>After capture, the compressed CO is transported to storage sites designed specifically for long-term sequestration. We use secure pipelines, specialized trucks, or ships to move the carbon, depending on the distance and infrastructure available. Throughout this journey, we adhere to strict safety protocols and environmental standards to minimize any risks and ensure the CO remains contained.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [345], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Securely Moving Compressed CO to Designated Storage Locations\"}',1,'2024-12-13 20:53:58','2024-12-13 20:53:58','b0b15492-7963-46b6-a00c-79108ae9a46a'),(1128,1128,2,'Sequestering Carbon Underground','sequestering-carbon-underground',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>At the storage site, we inject the CO deep underground into porous rock formations, such as depleted oil and gas reservoirs or saline aquifers. These formations are located thousands of feet beneath the surface, beneath layers of impermeable rock that act as natural barriers to prevent any upward migration. This process ensures that the CO remains securely stored, effectively reducing its presence in the atmosphere and contributing to climate change mitigation for generations to come.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [343], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Injecting and Storing Carbon Deep within Geological Formations\"}',1,'2024-12-13 20:53:58','2024-12-13 20:53:58','7dfc44aa-c8fa-4175-8ad5-ffe85b0627bc'),(1133,1133,2,'Identifying Optimal Locations','identifying-optimal-locations',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Selecting Land with High Solar Potential and Accessibility\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>Our process begins by assisting in the selection of land with the highest potential for solar energy production. We evaluate topography, proximity to power infrastructure, and ease of access. This ensures that each site offers maximum efficiency and viability for solar farm development, providing the ideal foundation for your renewable energy project.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[341]}',1,'2024-12-14 01:25:34','2025-02-20 19:36:11','3c8d7c32-88c5-4c90-9616-0563fae8ea59'),(1134,1134,2,'Securing Lease Agreements','securing-lease-agreements',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Creating Flexible Leasing Terms Tailored to Your Needs\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>Once a suitable site is identified, we work closely with you to develop a lease agreement that aligns with your projects goals and timeline. Our leasing terms are designed to be flexible, accommodating various project sizes and durations while ensuring long-term land stewardship. We offer support through every stage, from initial setup to ongoing operations, fostering a successful and sustainable partnership.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[342]}',1,'2024-12-14 01:25:34','2025-02-20 19:36:11','b42093f3-7743-4c5f-b7c5-58f29cc91697'),(1135,1135,2,'Solar Farm Leasing','solar-farm-leasing','land-minerals/solar-farm-leasing','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\": \"<h1>Harness the power of the sun</h1><p>Crosby Resource Management offers prime locations for solar farm development on our vast lands. With our commitment to sustainability and renewable energy, we provide flexible leasing options to help you generate clean energy while making a positive impact on the environment.</p>\", \"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"green-dark\", \"b43447ae-3d31-4a46-a6aa-ff1f680349db\": \"Identify & Secure\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": [329]}',1,'2024-12-14 01:25:34','2024-12-14 01:25:34','4e7dfd0c-56a6-4467-933e-9c8f2f574bda'),(1136,1136,2,'Identifying Optimal Locations','identifying-optimal-locations',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>Our process begins by carefully selecting land with the highest potential for solar energy production. We evaluate factors such as sunlight exposure, topography, proximity to power infrastructure, and ease of access. This ensures that each site offers maximum efficiency and viability for solar farm development, providing the ideal foundation for your renewable energy project.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [341], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Selecting Land with High Solar Potential and Accessibility\"}',1,'2024-12-14 01:25:34','2024-12-14 01:25:34','00c798e7-f127-4ebf-8672-25f9077345a9'),(1137,1137,2,'Securing Lease Agreements','securing-lease-agreements',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>Once a suitable site is identified, we work closely with you to develop a lease agreement that aligns with your projects goals and timeline. Our leasing terms are designed to be flexible, accommodating various project sizes and durations while ensuring long-term land stewardship. We support you through every stage, from initial setup to ongoing operations, fostering a successful and sustainable partnership.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [342], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Creating Flexible Leasing Terms Tailored to Your Needs\"}',1,'2024-12-14 01:25:34','2024-12-14 01:25:34','af4f6913-4258-4e84-8ec8-79a09f38728a'),(1141,1141,2,'Oil & Gas Exploration','oil-gas-exploration','land-minerals/oil-gas-exploration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\": \"<h1>Tapping potential, preserving legacy</h1><p>Crosby Resource Management partners with industry leaders to explore and develop oil and gas resources responsibly. With a focus on sustainable practices and local expertise, we manage our land to maximize its energy potential while protecting the environment for future generations.</p>\", \"6a43110f-ec6d-4eb6-b31d-a3105663387c\": \"green-light\", \"b43447ae-3d31-4a46-a6aa-ff1f680349db\": \"Assessment & Development\", \"caa2e4f9-5e75-483e-af00-a215b8e86e32\": [328]}',1,'2024-12-14 01:27:06','2024-12-14 01:27:06','5f2f86cb-9e17-413c-af93-e8b11dc1f95c'),(1142,1142,2,'Site Assessment and Preparation','test',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>Our exploration process starts with a comprehensive assessment of potential sites to identify areas with the highest oil and gas potential. We conduct geological surveys, environmental studies, and community consultations to ensure each site is suitable for development, balancing energy production with environmental stewardship.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [344], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Evaluating Land for Optimal Resource Development\"}',1,'2024-12-14 01:27:06','2024-12-14 01:27:06','8c355e68-46f3-4b18-9273-588a225006aa'),(1143,1143,2,'Collaborative Development','test',NULL,'{\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\": \"<p>Once a site is selected, we collaborate with experienced industry partners to develop and extract resources efficiently and responsibly. Our agreements prioritize sustainable practices, such as minimizing land disturbance, protecting local ecosystems, and employing advanced technologies to reduce environmental impact throughout the extraction process.</p>\", \"7f64e276-6f74-4484-a1ac-659d18eb16a0\": [340], \"c390edc7-79dd-485b-a3be-17447e1d0c73\": \"Partnering for Sustainable Exploration and Extraction\"}',1,'2024-12-14 01:27:06','2024-12-14 01:27:06','7416454c-ffb4-4acc-a874-aca274f5be26'),(1150,1150,2,NULL,'home','__home__','{\"1090b3af-4104-44b4-856d-6ae7a4414142\": \"<h1>Forestry rooted in family.</h1><p>For over 90 years, Crosby has been more than a companywere a family committed to the care and growth of Southern Louisianas forests. Through a blend of time-honored traditions and forward-thinking practices, we ensure our land thrives today and for generations to come.</p>\", \"17a82337-e15a-4935-91da-9f1a6ab334a0\": 5, \"3b7a89ee-57f2-4ada-b429-15b69621d8e0\": \"bottom-left\", \"b4a16dfe-0e7c-415b-897d-54ec75de7a03\": \"Our Company\", \"bcf01f2e-1625-49a8-89ae-3c62601301f6\": 900, \"bdf09a59-9eed-425d-9fbf-179f8006b17e\": [85, 99], \"e7a23981-db13-4a4a-83c6-7630fda02f58\": []}',1,'2024-12-14 02:18:02','2024-12-14 02:18:02','53688d70-fcdc-464b-bb49-dd2a9ac1f95f'),(1151,1151,2,'Crosby Day1 2024 L Janies 4743',NULL,NULL,NULL,1,'2024-12-14 02:19:28','2024-12-14 02:19:28','467a85b4-4391-4077-bf30-786b38d33f46'),(1159,1159,2,NULL,'__temp_nknhkqzbfhqzgbhifyhuzotbarcskomlptld',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\": 12, \"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\": \"green\", \"a2482014-8ed1-4637-b92e-d54de611f768\": \"justify-start items-end\"}',1,'2024-12-14 02:21:22','2024-12-19 20:29:51','c09e9116-6c7e-4972-9486-6943233e297b'),(1160,1160,2,NULL,'__temp_pqhjsfiuafqhiczaaljomflpnsrhyluzdyul',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\": 12, \"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\": \"red\", \"a2482014-8ed1-4637-b92e-d54de611f768\": \"justify-start items-start\"}',1,'2024-12-14 02:21:22','2024-12-19 20:38:23','d7267fb5-0f6e-49f2-bec5-6bf9c097e639'),(1161,1161,2,NULL,'__temp_plrbxzaacywkqcrjvbvjswzokjtqvadqktuh',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\": 12, \"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\": \"orange\", \"a2482014-8ed1-4637-b92e-d54de611f768\": \"justify-start items-start\"}',1,'2024-12-14 02:21:22','2024-12-19 20:23:33','b7a52908-1c69-48ef-bbd8-4d227c692f3a'),(1162,1162,2,NULL,'__temp_icdlburvxpqayglwdxmvlfcorwlcetsvlfeh',NULL,'{\"667a3b6d-bddf-4fcf-bc60-ce81f83faed3\": \"<figure class=\\\"image\\\"><img style=\\\"aspect-ratio:262/88;\\\" src=\\\"{asset:1169:url||/uploads/general/CCD.svg}\\\" width=\\\"262\\\" height=\\\"88\\\" alt=\\\"\\\" /></figure><p>Crosby Construction and Development