mpanys mission to responsibly manage over 134,000 acres.</p><p>Megan is known for his hands-on approach, often collaborating with local conservationists, contractors, and community stakeholders to enhance the lands value both economically and environmentally. He is particularly committed to restoring native habitats and implementing sustainable forestry practices that benefit both the land and the wildlife that depend on it. Outside of his work, Clay is an avid hunter and enjoys mentoring young foresters, passing on his knowledge and dedication to the next generation of land managers. His deep connection to the land and his community reflect the core values of Crosby Resource Management.</p>\",\"bce8a78b-0220-4d83-bcfe-53fa0beb1bd4\":\"Mlandry@crosbyresource.com\",\"123a45a4-3b8a-4a04-93b9-9da9cc635d84\":{\"value\":\"tel:1234567890\",\"type\":\"tel\",\"label\":null,\"target\":null},\"87bed415-dd42-4fd8-8671-4c9971c57da5\":[419]}',1,'2024-12-20 18:14:42','2025-04-09 19:01:47','38986b56-a0a2-4d55-a92c-8056aa27844e'),(1682,1682,2,'Austin Branham','austin-branham',NULL,'{\"123a45a4-3b8a-4a04-93b9-9da9cc635d84\": {\"type\": \"tel\", \"label\": null, \"value\": \"tel:3862140536\", \"target\": null}, \"5eb25c4e-2e11-4a0c-9070-2ee1bad8a0b2\": [], \"87bed415-dd42-4fd8-8671-4c9971c57da5\": [], \"bce8a78b-0220-4d83-bcfe-53fa0beb1bd4\": \"ausbranham@gmail.com\", \"fe33b24c-8ecb-4c14-955a-f10245b37458\": []}',1,'2024-12-20 18:14:59','2024-12-20 18:14:59','8729d9b6-b460-4ef0-8a5e-5a5b0464a6b7'),(1684,1684,2,'Longleaf Pine Preserve','bayou-pine-tract-3','land-minerals/real-estate/bayou-pine-tract-3','{\"20c831f6-11db-40d3-8cf1-b29e858a7ee5\": \"325\", \"599aea67-23c0-4160-b66a-299056df51b1\": 80000, \"5e1a8425-76f0-4ab6-b746-0d7c4a96f380\": [1086], \"7a9c701e-6e74-4854-9dbb-919c1556750a\": [613, 614, 612, 611, 610], \"7bbc9119-36fe-474b-acb2-60e803062b81\": [], \"8217b770-4692-43ce-a037-1964af20c2aa\": \"<p>A prestine tract located near XYZ, offering a mix of mature pine and hardw