7:35:36','52ee2981-3d5d-431a-9fdc-5656a804ba11'),(2116,2116,2,'Solar Project Leasing','solar-farm-leasing','land-minerals/solar-farm-leasing','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\":\"<h1>Harness the power of the sun</h1><p>Crosby Resource Management offers prime locations for solar farm development on our vast lands. With our commitment to sustainability and renewable energy, we provide flexible leasing options to help you generate clean energy while making a positive impact on the environment.</p>\",\"caa2e4f9-5e75-483e-af00-a215b8e86e32\":[329],\"b43447ae-3d31-4a46-a6aa-ff1f680349db\":\"Identify & Secure\",\"6a43110f-ec6d-4eb6-b31d-a3105663387c\":\"green-dark\"}',1,'2025-02-20 18:53:43','2025-02-20 18:53:43','422bbf8c-4832-403b-b3c0-906fb2bf2f60'),(2117,2117,2,'Identifying Optimal Locations','identifying-optimal-locations',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Selecting Land with High Solar Potential and Accessibility\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>Our process begins by assisting in the selection of land with the highest potential for solar energy production. We evaluate factors such as sunlight exposure, topography, proximity to power infrastructure, and ease of access. This ensures that each site offers maximum efficiency and viability for solar farm development, providing the ideal foundation for your renewable energy project.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[341]}',1,'2025-02-20 18:53:43','2025-02-20 18:53:43','e2be3cef-8fe2-4f67-94a6-dff9f81b0a36'),(2118,2118,2,'Securing Lease Agreements','securing-lease-agreements',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Creating Flexible Leasing Terms Tailored to Your Needs\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>Once a suitable site is identified, we work closely with you to develop a lease agreement that aligns with your projects goals and timeline. Our leasing terms are designed to be flexible, accommodating various project sizes and durations while ensuring long-term land stewardship. We support you through every stage, from initial setup to ongoing operations, fostering a successful and sustainable partnership.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[342]}',1,'2025-02-20 18:53:43','2025-02-20 18:53:43','cc7ddd48-c43d-4d00-993c-cdb4882a9cab'),(2120,2120,2,'Crosby Resource Management','resource-management','company/resource-management','{\"f0f656d0-b5be-4ed1-9e07-e1e0d9c6b76a\":\"<figure class=\\\"image\\\"><img style=\\\"aspect-ratio:539/123;\\\" src=\\\"{asset:109:url||/uploads/general/crm-logo.svg}\\\" alt=\\\"\\\" width=\\\"539\\\" height=\\\"123\\\" /></figure><p>Crosby Resource Management (CRM) was founded by Crosby Land &amp; Resources in 2007. CRM provides complete forest management and real estate services to landowners with 40 to over 100,000 acres. Headquartered inDeRidder, Louisiana, CRM now has clients across Southwest Louisiana.</p>\",\"17f13d88-c24b-45ec-a9a8-b72e351a64e0\":[110],\"70e14685-be41-435e-8982-4b74f9192f09\":\"Services we offer\",\"7df86719-f2be-407a-aa55-d39fcfb4888d\":\"Our expertise is land management\",\"03cde428-993b-4659-9ae5-a250bef25995\":\"Explore our diverse services to maximize land potential and preserve its future.\",\"1b5bf0c4-937e-4f9e-9fd0-dfc1e53ce6c9\":\"Were trusted\",\"b9fa69eb-557e-4d58-b68a-bef16f823fca\":\"Hear first hand from our partners & clients\",\"bf56f9d8-677b-438b-9955-f2c1c1fb35f0\":\"margin-bottom\",\"248d9bff-c9f9-4050-93ab-d7ed29dc3cb2\":\"margin-top\",\"788f5aa5-4cdf-4696-bcf3-77c383426c53\":\"red\"}',1,'2025-02-20 19:03:13','2025-02-20 19:03:13','dff712a6-b14e-4a20-a63b-9d2c9b44468d'),(2122,2122,2,'Carbon Injection & Sequestration','carbon-injection-sequestration','land-minerals/carbon-injection-sequestration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\":\"<h1>Innovative solutions for a greener future</h1><p>For decades, Crosby has led the way in sustainable land management. With recent carbon injection and sequestration developments, were advancing our commitment to environmental stewardship, balancing innovation with proven practices to protect our land and atmosphere for future generations.</p>\",\"caa2e4f9-5e75-483e-af00-a215b8e86e32\":[85],\"b43447ae-3d31-4a46-a6aa-ff1f680349db\":\"Capture, Transport & Sequester\",\"6a43110f-ec6d-4eb6-b31d-a3105663387c\":\"green\"}',1,'2025-02-20 19:19:07','2025-02-20 19:19:07','81cf9048-c1dd-4f0d-b0b5-104bb0580513'),(2123,2123,2,'Capturing Carbon','capturing-carbon',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Extracting and Compressing Carbon Dioxide from Industrial Emissions\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>Our process begins with capturing carbon dioxide (CO) from various industrial sources, such as power plants and natural gas facilities. Using advanced filtration and separation technologies, we isolate CO from other gases and impurities. Once separated, the CO is compressed into a highly concentrated form, preparing it for safe transport and efficient storage.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[339]}',1,'2025-02-20 19:19:07','2025-02-20 19:19:07','b610fbbc-0977-41e1-a21a-3d2ff39d288f'),(2124,2124,2,'Transporting Carbon Safely','transporting-carbon-safely',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Securely Moving Compressed CO to Designated Storage Locations\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>After capture, the compressed CO is transported to storage sites designed specifically for long-term sequestration. We use secure pipelines, specialized trucks, or ships to move the carbon, depending on the distance and infrastructure available. Throughout this journey, we adhere to strict safety protocols and environmental standards to minimize any risks and ensure the CO remains contained.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[345]}',1,'2025-02-20 19:19:07','2025-02-20 19:19:07','4abd18f0-32ef-4aa8-a2ce-a2acbbaf847e'),(2125,2125,2,'Sequestering Carbon Underground','sequestering-carbon-underground',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Injecting and Storing Carbon Deep within Geological Formations\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>At the storage site, we inject the CO deep underground into porous rock formations, such as depleted oil and gas reservoirs or saline aquifers. These formations are located thousands of feet beneath the surface, beneath layers of impermeable rock that act as natural barriers to prevent any upward migration. This process ensures that the CO remains securely stored, effectively reducing its presence in the atmosphere and contributing to climate change mitigation for generations to come.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[343]}',1,'2025-02-20 19:19:07','2025-02-20 19:19:07','6de19499-c18c-418a-a8c7-f2a2247aaf7c'),(2130,2130,2,'Carbon Injection & Sequestration','carbon-injection-sequestration','land-minerals/carbon-injection-sequestration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\":\"<h1>Innovative solutions for a greener future</h1><p>For decades, Crosby has led the way in sustainable land management. With recent carbon injection and sequestration developments, were advancing our commitment to environmental stewardship, balancing innovation with proven practices to protect our land and atmosphere for future generations.</p>\",\"caa2e4f9-5e75-483e-af00-a215b8e86e32\":[85],\"b43447ae-3d31-4a46-a6aa-ff1f680349db\":\"Capture, Transport & Sequester\",\"6a43110f-ec6d-4eb6-b31d-a3105663387c\":\"green\"}',1,'2025-02-20 19:30:52','2025-02-20 19:30:52','9933eb22-3c29-4635-b2bf-97f14371fcf6'),(2131,2131,2,'Capturing Carbon','capturing-carbon',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Extracting and Compressing Carbon Dioxide from Industrial Emissions\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>The process begins with capturing carbon dioxide (CO) from various industrial sources, such as power plants and natural gas facilities. Using advanced filtration and separation technologies, CO is isolated from other gases and impurities. Once separated, the CO is compressed into a highly concentrated form, preparing it for safe transport and efficient storage.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[339]}',1,'2025-02-20 19:30:52','2025-02-20 19:30:52','92369043-bcdc-44f8-80f4-753e34461e7a'),(2132,2132,2,'Transporting Carbon Safely','transporting-carbon-safely',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Securely Moving Compressed CO to Designated Storage Locations\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>After capture, the compressed CO is transported to storage sites designed specifically for long-term sequestration. Secure pipelines are used to move the carbon, depending on the distance and infrastructure available. Throughout this journey, strict safety protocols and environmental standards are used to minimize any risks and ensure the CO remains contained.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[345]}',1,'2025-02-20 19:30:52','2025-02-20 19:30:52','62cb05d8-8a4e-443c-9a0f-ba0b72579bda'),(2133,2133,2,'Sequestering Carbon Underground','sequestering-carbon-underground',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Injecting and Storing Carbon Deep within Geological Formations\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>At the storage site, CO is injected deep underground into porous rock formations, such as depleted oil and gas reservoirs or saline aquifers. These formations are located thousands of feet beneath the surface, beneath layers of impermeable rock that act as natural barriers to prevent any upward migration. This process ensures that the CO remains securely stored, effectively reducing its presence in the atmosphere and contributing to climate change mitigation for generations to come.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[343]}',1,'2025-02-20 19:30:52','2025-02-20 19:30:52','9d34d299-a599-421e-97c7-fb7a9827be4d'),(2135,2135,2,'Solar Project Leasing','solar-farm-leasing','land-minerals/solar-farm-leasing','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\":\"<h1>Harness the power of the sun</h1><p>Crosby offers prime locations for solar farm development on our vast lands. With our commitment to sustainability and renewable energy, we provide flexible leasing options to help you generate clean energy while making a positive impact on the environment.</p>\",\"caa2e4f9-5e75-483e-af00-a215b8e86e32\":[329],\"b43447ae-3d31-4a46-a6aa-ff1f680349db\":\"Identify & Secure\",\"6a43110f-ec6d-4eb6-b31d-a3105663387c\":\"green-dark\"}',1,'2025-02-20 19:32:17','2025-02-20 19:32:17','8e4186ee-5b43-46a0-921c-eb0c94e121ed'),(2139,2139,2,'Solar Project Leasing','solar-farm-leasing','land-minerals/solar-farm-leasing','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\":\"<h1>Harness the power of the sun</h1><p>Crosby offers prime locations for solar farm development on our vast lands. With our commitment to sustainability and renewable energy, we provide flexible leasing options to help you generate clean energy while making a positive impact on the environment.</p>\",\"caa2e4f9-5e75-483e-af00-a215b8e86e32\":[329],\"b43447ae-3d31-4a46-a6aa-ff1f680349db\":\"Identify & Secure\",\"6a43110f-ec6d-4eb6-b31d-a3105663387c\":\"green-dark\"}',1,'2025-02-20 19:36:11','2025-02-20 19:36:11','e23460f7-c43d-485f-b47d-47193fe08b9e'),(2140,2140,2,'Identifying Optimal Locations','identifying-optimal-locations',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Selecting Land with High Solar Potential and Accessibility\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>Our process begins by assisting in the selection of land with the highest potential for solar energy production. We evaluate topography, proximity to power infrastructure, and ease of access. This ensures that each site offers maximum efficiency and viability for solar farm development, providing the ideal foundation for your renewable energy project.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[341]}',1,'2025-02-20 19:36:11','2025-02-20 19:36:11','02ecc878-c3f9-49e6-95e8-9f6945b5c984'),(2141,2141,2,'Securing Lease Agreements','securing-lease-agreements',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Creating Flexible Leasing Terms Tailored to Your Needs\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>Once a suitable site is identified, we work closely with you to develop a lease agreement that aligns with your projects goals and timeline. Our leasing terms are designed to be flexible, accommodating various project sizes and durations while ensuring long-term land stewardship. We offer support through every stage, from initial setup to ongoing operations, fostering a successful and sustainable partnership.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[342]}',1,'2025-02-20 19:36:11','2025-02-20 19:36:11','fd3c55d2-27e2-46db-9382-cdbd3534ddc0'),(2145,2145,2,'Oil & Gas Exploration','oil-gas-exploration','land-minerals/oil-gas-exploration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\":\"<h1>Tapping potential, preserving legacy</h1><p>Crosby Resource Management partners with industry leaders to explore and develop oil and gas resources responsibly. We have an extensive land records data base as well as access to 3D seismic data for much of our ownership. With a focus on sustainable practices and local expertise, we manage our land to maximize its energy potential while protecting the environment for future generations.</p>\",\"caa2e4f9-5e75-483e-af00-a215b8e86e32\":[328],\"b43447ae-3d31-4a46-a6aa-ff1f680349db\":\"Assessment & Development\",\"6a43110f-ec6d-4eb6-b31d-a3105663387c\":\"green-light\"}',1,'2025-02-20 19:40:26','2025-02-20 19:40:26','74adb005-869a-45b6-8dff-511f1ecaabe5'),(2146,2146,2,'Site Assessment and Preparation','test',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Evaluating Land for Optimal Resource Development\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>The exploration process starts with a comprehensive assessment of potential sites to identify areas with the highest oil and gas potential. We help facilitate geological surveys, environmental studies, and community consultations to ensure each site is suitable for development, balancing energy production with environmental stewardship.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[344]}',1,'2025-02-20 19:40:26','2025-02-20 19:40:26','23889daf-91c2-4e31-b82b-d41b837f718b'),(2147,2147,2,'Collaborative Development','test',NULL,'{\"c390edc7-79dd-485b-a3be-17447e1d0c73\":\"Partnering for Sustainable Exploration and Extraction\",\"0584ff34-18ce-4f0a-aae8-3c694a88cbb6\":\"<p>Once a site is selected, we collaborate with experienced industry partners to develop and extract resources efficiently and responsibly. Our agreements prioritize sustainable practices, such as minimizing land disturbance, protecting local ecosystems, and employing advanced technologies to reduce environmental impact throughout the extraction process.</p>\",\"7f64e276-6f74-4484-a1ac-659d18eb16a0\":[340]}',1,'2025-02-20 19:40:26','2025-02-20 19:40:26','d7a8f508-f96e-473c-b5b4-183bec4704f8'),(2148,2148,2,'Land Sales','real-estate','land-minerals/real-estate','{\"a2094f8f-21e4-47cd-878d-603272fea893\":\"<p>From serene forest retreats to dynamic development sites, our properties offer unmatched potential for growth, recreation, and conservation.</p>\"}',1,'2025-02-20 19:43:36','2025-02-20 19:43:36','49be06bc-5614-465d-9021-3c4f65697ff6'),(2150,2150,2,'Land Sales','real-estate','land-minerals/real-estate','{\"a2094f8f-21e4-47cd-878d-603272fea893\":\"<p>From serene forest retreats to dynamic development sites, our properties offer unmatched potential for growth, recreation, and conservation.</p>\"}',1,'2025-02-21 17:09:28','2025-02-21 17:09:28','c61d74ea-8299-4efc-8a7d-6554c572fc0d'),(2151,2151,2,'Land Sales','real-estate','land-minerals/real-estate','{\"a2094f8f-21e4-47cd-878d-603272fea893\":\"<p>From serene forest retreats to dynamic development sites, our properties offer unmatched potential for growth, recreation, and conservation.</p>\"}',1,'2025-02-21 17:14:04','