and renewable energy, we provide flexible leasing options to help you generate clean energy while making a positive impact on the environment.</p>\",\"caa2e4f9-5e75-483e-af00-a215b8e86e32\":[329],\"b43447ae-3d31-4a46-a6aa-ff1f680349db\":\"Identify & Secure\",\"6a43110f-ec6d-4eb6-b31d-a3105663387c\":\"green-dark\"}',1,'2025-02-27 01:02:27','2025-02-27 01:02:27','e16d89c3-2979-4148-b894-fd6855cfb247'),(2176,2176,2,'Oil & Gas Exploration','oil-gas-exploration','land-minerals/oil-gas-exploration','{\"1146c4d0-8c65-42a7-a57a-07e7f2322c43\":\"<h1>Tapping potential, preserving legacy</h1><p>Crosby Resource Management partners with industry leaders to explore and develop oil and gas resources responsibly. We have an extensive land records data base as well as access to 3D seismic data for much of our ownership. With a focus on sustainable practices and local expertise, we manage our land to maximize its energy potential while protecting the environment for future generations.</p>\",\"caa2e4f9-5e75-483e-af00-a215b8e86e32\":[328],\"b43447ae-3d31-4a46-a6aa-ff1f680349db\":\"Assessment & Development\",\"6a43110f-ec6d-4eb6-b31d-a3105663387c\":\"green-light\"}',1,'2025-02-27 01:02:43','2025-02-27 01:02:43','c3e29710-e5c3-4b46-bfb3-033c359224a9'),(2177,2177,2,'The Beginning','the-beginning',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1888,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Hauling Logs With Oxen\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<p>Lucius Olen \\\"L.O.\\\" Crosby, Sr. (1869-1948)left the family cotton farm with a 3rd grade education at age 19 to work hauling logs behind oxen.</p><p>L.O. would go on to establish Goodyear Yellow Pine Company with his partner Lamont Rowlands. It would be one of the largest lumber operations in the south by the 1920\'s.</p>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"charcoal\"}',1,'2025-03-17 15:09:35','2025-03-18 20:10:27','ec8495d8-789b-4781-9ac4-f9446d9d84c8'),(2178,2178,2,NULL,'__temp_cgezyupdaaamfdyzwlxqmwrpbpnbwkiddrgx',NULL,'{\"60bd2228-3e30-4f2b-8a42-0c7bb2be3610\":[2022],\"ebcc3f78-ddc2-4556-9d54-531a1b99d364\":\"<p>L.O. Crosby Sr. - 1888</p>\",\"091cf9f9-54e9-4727-a6e8-0e69007b897a\":\"charcoal\"}',1,'2025-03-17 15:09:35','2025-04-28 20:07:53','31061671-f813-4b3a-8557-ee530c348f10'),(2179,2179,2,'Early Growth','early-growth',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1937,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"From Logs to Stumps\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<p>Goodyear Yellow Pine Company tried without success to interest someone in the Wood Naval Stores business to build a plant in Picayune, Mississippi to process stumps. Pine stumps were plentiful from the timber operations used to supply the Crosby owned sawmills.</p><p>Unable to attract a company to build a plant in Picayune, the family decided to undertake the project themselves.</p><p>After almost 40 years of owning and operating sawmills and related businesses, L.O. Crosby and his three sons, Robert Howell Crosby Sr., Hollis Crosby and L.O. Crosby Jr., Robert Sr., took the family into the Naval Store business. The plan was to develop a new manufacturing business that would not only bring significant economic rewards, but also begin the process of regenerating thousands of acres of company owned timberland.</p><p>Construction of the plant in Picayune, MS began in the spring of 1937 and operations began in November 1937.</p><p>Ninetybarrels of rosin were produced the first day. As the quality of the products being produced by Crosby became recognized, expansion of the Picayune plant had grown to 600 tons per day. By then it was one of the three largest producers of naval stores products in the United States.</p>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2025-03-17 15:09:35','2025-03-18 20:10:27','c37612d0-d41c-48e5-b688-46fb59f05096'),(2180,2180,2,NULL,'__temp_jlgxzwochzkzaesyamceuzhzdppvfdfgofsi',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\":\"charcoal\"}',1,'2025-03-17 15:09:36','2025-03-18 20:13:49','bcc30f12-7b5b-45df-bed1-9af3484fd154'),(2181,2181,2,NULL,'__temp_hotxlddpieblczjhgqgrqhkukvrbcvfkualn',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":6,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','20c7fb97-0043-4f1e-b053-ef196730645e'),(2182,2182,2,NULL,'__temp_cgsckablggqohrjdxwonroqfjfapxmbigbjv',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2038],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','2b0b6e78-29c3-4673-83dc-16ee798bfdd8'),(2183,2183,2,NULL,'__temp_qradaimpgrlajdcmifnifelralgbxgyymdfh',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2040],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','6fcf21fe-5271-4bf2-8f83-d6a9499dc6c5'),(2184,2184,2,NULL,'__temp_hvgkgcvvxrndgannravqlacxfvinoofndjxw',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2039],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','8b872475-15c9-4afa-abc5-c01e772589c4'),(2185,2185,2,NULL,'__temp_pqrmjfewguhalvuwvqensifbfaeaauxkvbby',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":6,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','6bd787f5-6655-4a9d-93ff-647789b35d46'),(2186,2186,2,NULL,'__temp_lztgqabiddofkamxgnsvdesphwfgoosaxyqj',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2040],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','4a00efb9-e93d-42d4-be54-329dd68cf148'),(2187,2187,2,NULL,'__temp_xzzzhcbjobmkxtsmncbxefypxchrnvcgrqit',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\"