ness to build a plant in Picayune, Mississippi to process stumps. Pine stumps were plentiful from the timber operations used to supply the Crosby owned sawmills.</li><li>Unable to attract a company to build a plant in Picayune, the family decided to undertake the project themselves.</li><li>After almost 40 years of owning and operating sawmills and related businesses, L.O. Crosby and his three sons, Robert Howell Crosby Sr., Hollis Crosby and L.O. Crosby Jr., Robert Sr., took the family into the Naval Store business. The plan was to develop a new manufacturing business that would not only bring significant economic rewards, but also begin the process of regenerating thousands of acres of company owned timberland.</li><li>Construction of the plant in Picayune, MS began in the spring of 1937 and operations began in November 1937.</li><li>Ninetybarrels of rosin were produced the first day. As the quality of the products being produced by Crosby became recognized, expansion of the Picayune plant had grown to 600 tons per day. By then it was one of the three largest producers of naval stores products in the United States.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','f10465d2-da6d-43f2-85ea-783524fef540'),(2193,2193,2,NULL,'__temp_mbxijgpjdgmdfpahjllawadbszqlszmlnzhs',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\":\"charcoal\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','a97c0158-d730-4240-b8cd-ad391d5eb6ed'),(2194,2194,2,NULL,'__temp_zievdqulzzgpsaosbfdksqrfayexbqswymos',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":4,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','66c880df-a4f6-4676-9bf8-9f3f75032e9d'),(2195,2195,2,NULL,'__temp_nlzbqdqxjdkdrrdnsrmrrugjsoeihnwkblal',NULL,'{\"e6f92a30-6ae8-4059-94df-50060c4a661c\":\"<p>1937 - The first naval stores plant in Picayune MS.</p>\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','5afb7ad5-4b6f-4514-a1da-0cff0581221b'),(2196,2196,2,NULL,'__temp_wqzkkpkwfjzodqqrjhovnkosteajfpkmzqlq',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2027],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','4be8dae4-f7d9-48f7-a564-edf4128d3b7f'),(2197,2197,2,NULL,'__temp_gazfyoavimlnuwnzuactkbmtzwrwtpqjfqlo',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":6,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','df422047-e13e-49bc-939b-1f0834286703'),(2198,2198,2,NULL,'__temp_daqglsazwecvmutjykuggprsogzgwrapnpdx',NULL,'{\"e6f92a30-6ae8-4059-94df-50060c4a661c\":\"<p>L.O.\'s five children, who would eventually inherit and manage the business.</p>\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','0d35dbfa-82ad-449b-9b2e-195a9baf6923'),(2199,2199,2,NULL,'__temp_etsfngsdosaxxnhmcpbjswkjkovmuftrkphs',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2031],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','4da290df-3174-40c0-b3b1-55fae936c755'),(2200,2200,2,'Expansion Post-War','expansion-post-war',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1945,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Growth and Diversification After World War II\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul><li>Near the end of World War II, the demand for Crosby products had grown to a size that one plant was unable to meet the demand of the trade. Other locations were surveyed for a new source of stumps and location of another plant.</li><li>After several months of land surveying, the new plant site was located and stumping rights to cut over land was secured. Due to its location in the middle of thousands of acres of \\\"virgin\\\" stump land, on three railroads, and within 50 miles of a deep water port, DeRidder, Louisiana, was selected as the location for a second plant. The land was considered poor and without much value and the purchase price reflected that fact. The resources that lay in these lands, predominantly longleaf pine stumps.</li><li>Robert H. Crosby Jr. joined the business full time after serving in WWII and headed to DeRidder for construction of LA plant. Soon after Robert H. Crosby Jr.s two brothers, Richard (Dick) Crosby and Tom Crosby joined the company and ran the sales and plant operations.</li><li>The DeRidder plant was designed for a 1,000 ton (stumps processed) daily capacity.</li><li>Thus, by 1947, from a small beginning 10 years earlier of a facility with a 250 ton daily capacity, Crosby Naval Stores grew into a successfulorganization, encompassing 2 plant facilities,capable of processing 1,600 tons of stumps daily. Crosby Naval Stores employed between 500 and 600 people in plant operations and from 1,000 to 1,200 in stump operations.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"charcoal\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','6b741b62-2d1b-430b-9f2e-4c685089ceef'),(2201,2201,2,NULL,'__temp_etkhjlzmfnqeofbbdjylsgagcglnvsijiygm',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\":\"red\"}',1,'2025-03-17 15:09:36','2025-03-17 15:09:36','85db43c0-e26a-4930-ab4b-3e79bc842d24'),(2202,2202,2,NULL,'__temp_hotxlddpieblczjhgqgrqhkukvrbcvfkualn',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":6,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-03-17 15:09:37','2025-03-17 15:09:37','cbc0a46b-4cc9-4b3e-82ca-84086506fbb6'),(2203,2203,2,NULL,'__temp_cgsckablggqohrjdxwonroqfjfapxmbigbjv',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2038],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-17 15:09:37','2025-03-17 15:09:37','7d8b9c8a-abd7-4b39-97bb-9053034e69f9'),(2204,22