LL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1888,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Hauling Logs With Oxen\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:circle;\\\"><li><p>Lucius Olen \\\"L.O.\\\" Crosby, Sr. (1869-1948)left the family cotton farm with a 3rd grade education at age 19 to work hauling logs behind oxen.</p><p></p></li><li>L.O. would go on to establish Goodyear Yellow Pine Company with his partner Lamont Rowlands. It would be one of the largest lumber operations in the south by the 1920\'s.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"charcoal\"}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','85a32146-eb7e-4d6d-8ff1-52563693316f'),(2230,2230,2,'Early Growth','early-growth',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1937,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"From Logs to Stumps\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:circle;\\\"><li><p>Goodyear Yellow Pine Company tried without success to interest someone in the Wood Naval Stores business to build a plant in Picayune, Mississippi to process stumps. Pine stumps were plentiful from the timber operations used to supply the Crosby owned sawmills.</p><p></p></li><li><p>Unable to attract a company to build a plant in Picayune, the family decided to undertake the project themselves.</p><p></p></li><li><p>After almost 40 years of owning and operating sawmills and related businesses, L.O. Crosby and his three sons, Robert Howell Crosby Sr., Hollis Crosby and L.O. Crosby Jr., Robert Sr., took the family into the Naval Store business. The plan was to develop a new manufacturing business that would not only bring significant economic rewards, but also begin the process of regenerating thousands of acres of company owned timberland.</p><p></p></li><li><p>Construction of the plant in Picayune, MS began in the spring of 1937 and operations began in November 1937.</p><p></p></li><li>Ninetybarrels of rosin were produced the first day. As the quality of the products being produced by Crosby became recognized, expansion of the Picayune plant had grown to 600 tons per day. By then it was one of the three largest producers of naval stores products in the United States.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','684536ef-55f6-4d44-8a9c-fc9516897fe6'),(2231,2231,2,NULL,'__temp_pfijnsxebtaodfzmhpdzeeipbkqzpcebkcwj',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\":\"red\"}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','bcfa5c15-f4f5-4720-977f-3eaa609e827c'),(2232,2232,2,NULL,'__temp_zievdqulzzgpsaosbfdksqrfayexbqswymos',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":4,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','4f81b12c-60c6-4ebb-b6aa-5bf53e1973c2'),(2233,2233,2,NULL,'__temp_nlzbqdqxjdkdrrdnsrmrrugjsoeihnwkblal',NULL,'{\"e6f92a30-6ae8-4059-94df-50060c4a661c\":\"<p>1937 - The first naval stores plant in Picayune MS.</p>\"}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','9e216ad0-18cb-44fd-93d0-9810b55825c8'),(2234,2234,2,NULL,'__temp_wqzkkpkwfjzodqqrjhovnkosteajfpkmzqlq',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2027],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','c21f365a-54d3-464a-aa85-31b44d2e8d81'),(2235,2235,2,NULL,'__temp_gazfyoavimlnuwnzuactkbmtzwrwtpqjfqlo',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":6,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','5ccf91b7-89ff-4d38-832e-6377b46887a5'),(2236,2236,2,NULL,'__temp_daqglsazwecvmutjykuggprsogzgwrapnpdx',NULL,'{\"e6f92a30-6ae8-4059-94df-50060c4a661c\":\"<p>L.O.\'s five children, who would eventually inherit and manage the business.</p>\"}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','0c27954e-83f9-480b-b7eb-fe57f9b7900e'),(2237,2237,2,NULL,'__temp_etsfngsdosaxxnhmcpbjswkjkovmuftrkphs',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2031],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-03-18 20:09:11','2025-03-18 20:09:11','1e3c1a13-98c3-45c0-a141-a486c00c8205'),(2242,2242,2,'History','history','about/history',NULL,1,'2025-03-18 20:10:27','2025-03-18 20:10:27','b92a7f5b-7e7b-401c-bf3f-e1531c0e085e'),(2243,2243,2,'The Beginning','the-beginning',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1888,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Hauling Logs With Oxen\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<p>Lucius Olen \\\"L.O.\\\" Crosby, Sr. (1869-1948)left the family cotton farm with a 3rd grade education at age 19 to work hauling logs behind oxen.</p><p>L.O. would go on to establish Goodyear Yellow Pine Company with his partner Lamont Rowlands. It would be one of the largest lumber operations in the south by the 1920\'s.</p>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"charcoal\"}',1,'2025-03-18 20:10:27','2025-03-18 20:10:27','75931ba6-5468-4318-b389-3c0c3804c431'),(2244,2244,2,'Early Growth','early-growth',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1937,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"From Logs to Stumps\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<p>Goodyear Yellow Pine Company tried without success to interest someone in the Wood Naval Stores business to build a plant in Picayune, Mississippi to process stumps. Pine stumps were plentiful from the timber operations used to supply the Crosby owned sawmills.</p><p>Unable to attract a company to build a plant in Picayune, the family decided to undertake the project themselves.</p><p>After almost 40 years of owning and operating sawmills and related businesses, L.O. Crosby and his three sons, Robert Howell Crosby Sr., Hollis Crosby and L.O. Crosby Jr., Robert Sr., took the family into the Naval Store business. The plan was to develop a new manufacturing business that would not only bring significant economic rewards, but also begin the process of regenerating thousands of acres of company owned timberland.</p><p>Construction of the plant in Picayune, MS began in the spring of 1937 and operations began in November 1937.</p><p>Ninetybarrels of rosin were produced the first day. As the quality of the products being produced by Crosby became recognized, expansion of the Picayune plant had grown to 600 tons per day. By then it was one of the three largest producers of naval stores products in the United States.</p>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2025-03-18 20:10:27','2025-03-18 20:10:27','d496c262-9f94-42fa-bf53-1c56d65dc31e'),(2245,2245,2,NULL,'__temp_rsbosrgqfweuixbpkydjqhfqucotenuprxoo',NULL,'{\"e0bb6651-04f1-46c9-b56d-338199065ec1\":\"<h2>As America rebuilt after World War II, Crosby Resource Management expanded its operations, seizing the opportunity to grow. The post-war boom laid the groundwork for our future success, transforming the company into a leader in sustainable land management.</h2>\",\"8f1ac14d-b468-486f-ac52-c9481fa77611\":\"red\"}',1,'2025-03-18 20:10:27','2025-03-18 20:10:27','5091bb07-bebe-4a88-a8ee-58c3cb37296d'),(2249,2249,2,'History','history','about/history',NULL,1,'2025-03-18 20:13:49','2025-03-18 20:13:49','34358ca1-7c38-49e6-8a19-5ba34ad54c13'),(2250,2250,2,NULL,'__temp_jlgxzwochzkzaesyamceuzhzdppvfdfgofsi',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\":\"charcoal\"}',1,'2025-03-18 20:13:50','2025-03-18 20:13:50','de80a59e-99f6-4113-b930-493aa55267a9'),(2251,2251,2,NULL,'__temp_rqzduzejtuyibcwbexchikxutqfpsjjqaizp',NULL,'{\"e0bb6651-04f1-46c9-b56d-338199065ec1\":\"<h2>As America rebuilt after World War II, Crosby Resource Management expanded its operations, seizing the opportunity to grow. The post-war boom laid the groundwork for our future success, transforming the company into a leader in sustainable land management.</h2>\",\"8f1ac14d-b468-486f-ac52-c9481fa77611\":\"charcoal\"}',1,'2025-03-18 20:13:50','2025-03-18 20:13:50','fdbf8a1b-0773-414a-9fdd-8fee195dc5a4'),(2254,2254,2,'History','history','about/history',NULL,1,'2025-03-18 20:14:14','2025-03-18 20:14:14','39f56346-4fbf-450d-b386-878be79b81ac'),(2255,2255,2,'Expansion Post-War','expansion-post-war',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1945,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Growth and Diversification After World War II\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<p>Near the end of World War II, the demand for Crosby products had grown to a size that one plant was unable to meet the demand of the trade. Other locations were surveyed for a new source of stumps and location of another plant.</p><p>After several months of land surveying, the new plant site was located and stumping rights to cut over land was secured. Due to its location in the middle of thousands of acres of \\\"virgin\\\" stump land, on three railroads, and within 50 miles of a deep water port, DeRidder, Louisiana, was selected as the location for a second plant. The land was considered poor and without much value and the purchase price reflected that fact. The resources that lay in these lands, predominantly longleaf pine stumps.</p><p>Robert H. Crosby Jr. joined the business full time after serving in WWII and headed to DeRidder for construction of LA plant. Soon after Robert H. Crosby Jr.s two brothers, Richard (Dick) Crosby and Tom Crosby joined the company and ran the sales and plant operations.</p><p>The DeRidder plant was designed for a 1,000 ton (stumps processed) daily capacity.</p><p>Thus, by 1947, from a small beginning 10 years earlier of a facility with a 250 ton daily capacity, Crosby Naval Stores grew into a successfulorganization, encompassing 2 plant facilities,capable of processing 1,600 tons of stumps daily. Crosby Naval Stores employed between 500 and 600 people in plant operations and from 1,000 to 1,200 in stump operations.</p>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"charcoal\"}',1,'2025-03-18 20:14:14','2025-03-18 20:14:14','e92e1c09-b7e7-4a74-b807-cf0be8fc5af1'),(2258,2258,2,NULL,'__temp_hdckknfhffxpvofjcevsgfsinvvpjchltiub',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-04-09 16:00:08','2025-04-09 16:00:08','7ab783c3-528e-4b1f-bc7b-9124a89f3825'),(2260,2260,2,'Goodyer Yellow Pine Locomotive 1917 1937',NULL,NULL,NULL,1,'2025-04-09 16:01:47','2025-04-09 16:03:32','63d5563c-9a77-4788-afa8-1071e120cf7a'),(2269,2269,2,NULL,'__temp_pbynrxgbpqaejcaktckprsrctvkdemqbtcnw',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":4,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-04-09 17:54:09','2025-04-09 18:00:21','f879d3a1-90c6-457e-8457-c90ccb6177b0'),(2270,2270,2,NULL,'__temp_inooinsndjofptiawcjdldsorrchejknbumu',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2272],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-04-09 17:54:12','2025-04-09 17:59:20','d3f86afc-0295-488e-80d5-eab657858dfd'),(2271,2271,2,'Crosby Chemical 1',NULL,NULL,NULL,1,'2025-04-09 17:55:16','2025-04-09 17:55:16','016a5135-9a01-4714-ae99-61d3cf90efec'),(2272,2272,2,'1937 Picayune',NULL,NULL,NULL,1,'2025-04-09 17:58:42','2025-04-09 17:59:14','dbc58afd-30d7-4569-8bee-2f6c9687d353'),(2280,2280,2,NULL,'__temp_shxhzkhpjiocstqmvkgdurhszxcfyfxjtbfh',NULL,'{\"aad8a471-f154-4412-b1ba-4611203d4f55\":\"red\"}',1,'2025-04-09 18:01:14','2025-04-09 18:43:22','b688924c-d92e-4258-8d6f-7458add4da6e'),(2281,2281,2,NULL,'__temp_shiuezfhfphapgoztjensqnbdnrgmypojmvp',NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":4,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-04-09 18:01:14','2025-04-09 18: