nsolidation and Product Evolution\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:disc;\\\"><li>By 1948, the company accumulated approximately 150,000 acres in Louisiana.</li><li>R.H. Crosby, Sr. and his family gained complete ownership of Crosby Chemicals, Inc. from his extended family.</li><li>The stumps on the family-owned property were running out and the plants were converted to Tall Oil Plants which allowed the company to continue to produce new versions of the same products.</li><li>Tall oil resins are used as a component of adhesives, rubber, and inks. Crosby purchased tall oil from paper mills and sold refined products to companies such as 3M.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2025-04-09 18:01:16','2025-04-09 18:01:16','7e1c6a90-1f9b-44a6-8ea7-19e53590b32c'),(2303,2303,2,'Mineral Rich Lands','a-new-millennium-of-growth',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":1990,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Expanding Beyond Timber\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:disc;\\\"><li><strong>Crosby Chemicals</strong>changed its name to<strong>Crosby Land&amp; Resources</strong>, a Mississippi partnership.</li><li>The Company saw unprecedented development of its minerals from 1995-2001 due primarily to the oil and gas exploration of the Austin Chalk geological formation.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2025-04-09 18:01:16','2025-04-09 18:01:16','2cc75850-ddbc-487b-8a47-4dc4c76b53fc'),(2304,2304,2,'Back to our \"Roots\"','renewable-energy-initiatives',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":2007,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Taking on a direct roll in the management of our timberland\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:disc;\\\"><li>The Company formed<strong>Crosby Resource Management, L.L.C.</strong>, a full service forest management company, headquartered in Sugartown, Louisiana.</li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"white\"}',1,'2025-04-09 18:01:16','2025-04-09 18:01:16','6b05c5dd-e41d-4082-943d-bfdd8d00c677'),(2305,2305,2,'Going Out on Our Own','going-out-on-our-own',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":2022,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Taking Total Responsiblity For the Land\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:disc;\\\"><li><span style=\\\"color:#000000;\\\">Long term timber lease was terminated with 3rd party. Sole responsibility of harvesting and delivery of wood becomes CRMs.</span></li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2025-04-09 18:01:16','2025-04-09 18:01:16','90038dbe-bd49-426f-a4ee-d758ffdd9bbf'),(2315,2315,2,NULL,'__temp_rycxsbrotuzvgtezivdydidofdtlfnmnwgft',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[2272],\"14fe5258-3e30-4737-adf0-1a4c5490f897\":[],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-04-09 18:43:22','2025-04-09 18:43:22','a11da499-7346-4a64-962a-eaa6d37ff366'),(2316,2316,2,'Going Out on Our Own','going-out-on-our-own',NULL,'{\"582d1ba6-ac48-4124-8202-3eb246013891\":2022,\"e66a1ce8-b8b9-4995-b7cf-456a8e43eff9\":\"Taking Total Responsiblity For the Land\",\"40fdf764-e36c-467b-a7a9-4dc2ffd5a4df\":\"<ul style=\\\"list-style-type:disc;\\\"><li><span style=\\\"color:hsl(0,0%,0%);\\\">After the long-term timber lease was terminated, sole responsibility of harvesting and delivery of wood became CRMs.</span></li><li><span style=\\\"color:hsl(0,0%,0%);\\\">The land being unemcumbered has allowed CRM to explore new opportunites such as solar and carbon injection, while at the same time, experimenting with new technological advancements in silviculture. </span></li></ul>\",\"f47025ea-51f8-4636-9d11-c7095203cb70\":\"red\"}',1,'2025-04-09 18:43:22','2025-04-28 20:07:53','ac66bce1-52a1-40db-8f4a-03d1a6f1697f'),(2317,2317,2,'History','history','about/history',NULL,1,'2025-04-09 18:43:22','2025-04-