 draft a plan that allows you to responsibility manage your land and get the most out of it.</p>\"}',1,'2025-04-29 15:09:25','2025-04-29 15:09:25','0e8d6645-8e87-4b19-a0ef-687d3e519a86'),(2445,2445,2,NULL,NULL,NULL,'{\"767dd143-bab0-4ede-b4c9-b4e738db73d7\":6,\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-04-29 15:09:25','2025-04-29 15:09:25','42fb2996-b26e-4f6b-aed8-8e8aa23050ab'),(2446,2446,2,NULL,'__temp_lemkvrahywrshfqrbzazmqvgdrdlgjbtffnx',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[1097],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-04-29 15:09:25','2025-04-29 15:09:25','3e1e3ba4-ee81-4830-89ed-c060266c84ad'),(2447,2447,2,NULL,'__temp_rycnzssnnaxuglvymttohruqlmikrcjijlww',NULL,'{\"dc24a613-fcc8-4e01-b714-d730f6b73517\":\"<h4>Timber Sale Administration</h4><p>CRM foresters will administer the logging and transportation of your timber to the mill. The team will ensure that the logs are merchandised correclty and that your property is left in good condition. Our connecitons to local mills and market knowledge will ensure that your receive the best price possible.</p>\"}',1,'2025-04-29 15:09:25','2025-04-29 15:09:25','59e9b8a6-6d72-40a4-9eff-d8913ed25173'),(2448,2448,2,NULL,'forest-inventory-and-valuation',NULL,'{\"85ee3a3c-6eba-4a01-a5a6-f23bf2862f29\":\"red\",\"a2482014-8ed1-4637-b92e-d54de611f768\":\"justify-start items-end\"}',1,'2025-04-29 15:09:25','2025-04-29 15:09:25','7c7d6924-71d0-4fdd-81f8-c3f9bcc9ef15'),(2449,2449,2,NULL,'__temp_kypqheqrjbtxhpnjdbvhmkeqtrjlgftsjwmd',NULL,'{\"5df28b39-bbb0-4570-afef-5054ff1fa042\":[434],\"b9f9ae0c-022e-43b1-ac31-bdbee2345b55\":true}',1,'2025-04-29 15:09:25','2025-04-29 15:09:25','8f70ee4e-8277-4bbd-a8d2-292cc3158e4c'),(2450,2450,2,NULL,'__temp_siirqqdvqrjbfjdynoucltevamaaswfmxtax',NULL,'{\"dc24a613-fcc8-4e01-b714-d730f6b73517\":\"<h4>Forest Inventory and Valuation</h4><p>Knowing the value of what you have is key to making man